import React, {useState} from 'react'
import { Image, Col, Container, Row, Navbar, NavDropdown, Card, Accordion  } from 'react-bootstrap'
import {logout} from '../../services/auth.js'

import Calendar  from 'react-calendar'
import 'react-calendar/dist/Calendar.css';

import Loader from '../../component/Loader'
import logoImg from '../../assets/logo.png';
import ActionsUserRegistration from '../../actions/UserRegistration/UserRegistration'
import './Dashboard.css'


export default function Dashboard (props) {
    const param = props.location.param || {}
    let name = ''
    if (param.user) {
        name = param.user[0].name
    }

    const [nome, setNome] = useState('Dayan Fretias');
    const [img, setImg] = useState('data:image/png;base64,');

    const [date, setDate] = useState(new Date());
   
        
    const onChange = date => {
        setDate(date)
    }

    const onClick = () => {
        alert('data: ' + date.toISOString())   
    }
    
    const onClickAgendamento = (item) => {
        console.log('item', item)
        alert('item')
    }
    
    const sair = () => {
        logout()
        
        props.history.push({
            pathname: '/'
            // param: {
            //   user: r.user
            // }
        });
    }


    const lista = [
        {id: 1, descricao: 'Segunda - 15/09/2020', horario_inicio: '12:00', horario_fim: '13:00', valor_total: 10},
        {id: 2, descricao: 'Tera - 16/09/2020', horario_inicio: '13:00', horario_fim: '14:00', valor_total: 10}]

    const TemplateAgendamentos = (props) => {
        const {arr} = props
        let t = ''
        t = arr.map((item) => {
                return (
                    <Card body className="mt-2" onClick={onClickAgendamento}>
                        <Card.Title>{item.descricao}</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">{item.horario_inicio}-{item.horario_fim}</Card.Subtitle>
                        <Card.Subtitle className="mb-2 text-muted">Valor total: {item.valor_total}</Card.Subtitle>
                    </Card>
                )
            })
        return (
            <div>
                {t}                
            </div>
        );
    }
    return (
        <div>
            <Navbar className="nav-style">
                <Navbar.Brand href="#home">
                <img
                    src={logoImg}
                    width="60"
                    height="60"
                    className="d-inline-block align-top"
                    alt="Logo"
                />
                </Navbar.Brand>
                Aluguel de quadras
                
                <Navbar.Collapse className="justify-content-end">
                    <Image src={img} roundedCircle height="60" width="60"/><br/>
                    <NavDropdown title={nome} id="collasible-nav-dropdown">
                    <NavDropdown.Item onClick={sair}>Sair</NavDropdown.Item>
                </NavDropdown>
                </Navbar.Collapse>
            </Navbar>

            <Container className="mt-5">
                <Row>
                    <Col>
                      <h3>Agendamentos:</h3>
                      <TemplateAgendamentos arr={lista}/>
                      {/* <Card>
                        <Card.Header>
                        <Accordion.Toggle variant="link" eventKey="0">
                            Click me!
                        </Accordion.Toggle>
                        </Card.Header>
                            <Accordion.Collapse eventKey="0">
                                <Card.Body>Hello! I'm the body</Card.Body>
                            </Accordion.Collapse>
                        </Card> */}
                    </Col>

                    <Col md="6">
                        <Calendar
                        onClickDay={onClick}
                        onChange={onChange}
                        value={date}
                        />    
                    </Col>
                    
                </Row>
            </Container>
        </div>

    );
}

